import { useState } from 'react';
import './App.css';
import { Auth_field } from './Auth_field';

export function Input_field({text, value, onChange}){
  return (
    <>
      <input type="text" placeholder={text} value={value} onChange={onChange}/>
    </>
  );
}

export function Button({ value, handleClick })
{
  return (
    <button className='connection_button' onClick={handleClick}>
      {value}
    </button>
  )
}


function App() {
  const [isLogin, setIsLogin] = useState(false);
  function handleLogin(){
    setIsLogin(true);
  }
  return (
    <>
      <h1>TRANSCENDANCE</h1>
      <main>
        <div className='app'>
          {!isLogin ? (<Auth_field onLogin={() => handleLogin()}/>)
            : (<div>salut</div>)
          }
        </div>
      </main>
    </>
  );
}

export default App;
